import React from 'react'
import {Link} from 'react-router-dom'
const Navbar = () => {
  return (
    <div>
        <Link to="./">Home</Link><br></br>
        <Link to="/About">About</Link>
        <Link to="/Servicces">Servicces</Link>

        
    </div>
  )
}

export default Navbar
